import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Router ja Routes komponentit
import Login from './Login'; // Kirjautumissivu
import Rekisterointi from './Rekisterointi'; // Rekisteröintisivu, jos tämä on olemassa




function App() {
  return (
    <Router>
      <div>
        <Routes>
          {/* Lisää sovelluksen reitit */}
          <Route path="/" element={<Kotisivu />} /> 
          <Route path="/rekisterointi" element={<Rekisterointi />} />
          <Route path="/kirjautuminen" element={<Login />} />
          <Route path="/hallinta" element={<Hallinta />} />
          <Route path="/palvelut" element={<Palvelut />} /> {/* Tämä on sivu kirjautumisen jälkeen */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
